import { observer } from "mobx-react-lite";
import { BrowserRouter } from "react-router-dom";
import AppRouter from "./components/ApprRouter";



const App = observer(() => {
	return (
		<BrowserRouter>
			<AppRouter />
		</BrowserRouter>
	);
})

export default App;
